import { createRoute } from "@tanstack/react-router";
import { Route } from "../routes/__root";
//@ts-ignore
import TemplatesImg from "../_shared/assets/svg/home/templates.svg";
//@ts-ignore
import EmailImg from "../_shared/assets/svg/home/email.svg";
//@ts-ignore
import LandersImg from "../_shared/assets/svg/home/landers.svg";
//@ts-ignore
import LandersWhiteImg from "../_shared/assets/svg/home/landers-white.svg";
//@ts-ignore
import LockImg from "../_shared/assets/images/lock-tag.png";

const StyleClassGroup = {
  homePageWrapper: "flex-col gap-2 p-[20px] w-full",
  row: "flex gap-3 items-center",
  column: "flex-col gap-2",
  rowSpaceBetween: "flex gap-2 justify-between w-full",
  buttonNormal:
    "border py-[10px] px-[15px] rounded-lg text-[13px] border-black",
  buttonPurple:
    "border py-[10px] px-[15px] rounded-lg text-[13px] bg-gradient-to-b from-[#A259FF] to-[#613599]",
  textGradientTopDown:
    "text-[20px] bg-gradient-to-b from-[#A259FF] to-[#613599] bg-clip-text text-transparent font-semibold",
  basicText: "text-[14px]",
};

const HomePage = () => {
  return (
    <div className={StyleClassGroup.homePageWrapper}>
      <div className={StyleClassGroup.rowSpaceBetween}>
        <div className={StyleClassGroup.row}>
          <div className={StyleClassGroup.buttonNormal}>Back</div>
          <div className={StyleClassGroup.textGradientTopDown}>Brand name</div>
        </div>
        <div className={StyleClassGroup.row}>
          <span className={StyleClassGroup.basicText}>Show:</span>
          <div className={StyleClassGroup.buttonNormal}>
            <div className={StyleClassGroup.row}>
              <img src={TemplatesImg} alt={"Templates"} className="w-3 h-3" />
              <span>Templates</span>
            </div>
          </div>
          <div className={StyleClassGroup.buttonNormal}>
            <div className={StyleClassGroup.row}>
              <img src={EmailImg} alt={"Templates"} className="w-3 h-3" />
              <span>Email</span>
              <img
                src={LockImg}
                alt={"Templates"}
                className="w-[33px] h-[20px]"
              />
            </div>
          </div>
          <div className={StyleClassGroup.buttonNormal}>
            <div className={StyleClassGroup.row}>
              <img src={LandersImg} alt={"Templates"} className="w-3 h-3" />
              <span>Landers</span>
              <img
                src={LockImg}
                alt={"Templates"}
                className="w-[33px] h-[20px]"
              />
            </div>
          </div>
          <div className={StyleClassGroup.buttonPurple}>
            <div className={StyleClassGroup.row}>
              <img
                src={LandersWhiteImg}
                alt={"Templates"}
                className="w-3 h-3"
              />
              <span className="text-white">Funnels</span>
              <img
                src={LockImg}
                alt={"Templates"}
                className="w-[33px] h-[20px]"
              />
            </div>
          </div>
        </div>
        <div className={StyleClassGroup.row}>
          <div className={StyleClassGroup.buttonNormal}>Save</div>
          <div className={StyleClassGroup.buttonNormal}>Share</div>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
export const homePageRoute = createRoute({
  getParentRoute: () => Route,
  path: "/",
  component: HomePage,
});
